window.addEventListener("load", function(event){
    alert('Page2 loaded');
    let response = document.getElementById("text_response");
    let search_result = window.location.search.substr(10);
    if ((search_result in RechercheEchange) === false){
        window.location = "Page.html"
    }
    response.innerHTML = search_result;
    pageFill(search_result);
});

function pageFill(object){
    let nom = document.getElementById("objet_nom");
    let image = document.getElementById("objet_image");
    let vendeur = document.getElementById("objet_vendeur");
    let desire = document.getElementById("objet_desire");
    let description = document.getElementById("objet_description");

    nom.innerHTML = RechercheEchange[object].nom;
    image.src = RechercheEchange[object].image;
    vendeur.innerHTML = RechercheEchange[object].vendeur;
    desire.innerHTML = RechercheEchange[object].desire;
    description.innerHTML = RechercheEchange[object].description;

}

function objectSearch(value){
    value = value.toLowerCase();
    alert(RechercheEchange[value]);
    window.location = "Page2.html?response="+ value;
}
